import Navigation from '../../components/Navigation';

function CreateCartoons() {
  return (
    <>
      <Navigation />
      <Typography variant="h1" gutterBottom>
        Create Cartoon
      </Typography>
      <form>
        <input type="text"></input>
      </form>
    </>
  );
}

export default CreateCartoons;
